import styled from 'styled-components'


export const StyledDashboard = styled.div`
	width: 100%;
  height: 200px;
  max-width: 500px;
  margin: 0 auto;
`;

export const PitRow = styled.div`
	width: 100%;
	height: 400px;
  	text-align: center;
`;

export const ScoreRow = styled.div`
  width: 100%;
  height: 200px;
  text-align: center;
`;

export const TitleRow = styled.div`
	width: 100%;
  height: 70px;
  text-align: center;
  line-height: 80px;
`;

export const StyledButton = styled.button`
  width: 100%;
  height: 35px;
  cursor: pointer;
  background: #d23737;
  color: white;
  font-size: 14px;
  border: 1px solid #d23737;
  border-radius: 3px;
  line-height: 30px;
`;

export const ButtonRow = styled.div`
  width: 100%;
  height: 70px;
  text-align: center;
  line-height: 80px;
  margin-top: 140px;
`;
